import React from 'react';
import NavBar from '../NavBar';
import Footer from '../Footer';
import { Container, Row, Col } from 'react-bootstrap';
import Action from './ProfileComps/Action';


export default function Molly(){
    return (
        <div>
            <NavBar/>
            <img className="firstImage" src="https://images.pexels.com/photos/2253275/pexels-photo-2253275.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" alt="molly" />
            <header className="adopt-cat-title">Molly</header>
            <div className="adopt-cat-text">Molly is  acuddle bug</div>
            <div className="petLeftContainer"></div>
            <div>My Profile</div>
            <div>Status</div>
            <div>Avaiable for Adoption</div>
            <div className="petRightContaier"></div>
            <div>            <img src="https://images.pexels.com/photos/2253275/pexels-photo-2253275.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" alt="molly" />
</div>
            <div>who</div>
            <div>let</div>
            <div>me</div>
            <Footer/>
            <Action/>
        </div>
    )
}
